import React, { Component } from 'react';

export default class Login extends Component {
  render() {
    return (
      <section>
        <h1>Insira seu Login</h1>
        <div>
          <input
            type="email"
            placeholder="Email"
            data-testid="email-input"
            required
          />
          <input
            type="password"
            placeholder="Senha"
            data-testid="password-input"
            minLength="6"
            required
          />
        </div>
      </section>
    );
  }
}
